import React, { Component } from 'react';
import SlideArrow from './SlideArrow';
import SlideImage from './SlideImage';
import './SlideBar.css';

class SlideBar extends Component{

    state = {
        currentImageIndex: 0
    };


    render(){
        return(
            <div>
               <SlideArrow direction="left" clickFunction={ this.previousSlide } glyph="&#9654;" />
               <SlideImage />
               <SlideArrow direction="right" clickFunction={ this.nextSlide } glyph="&#9654;" />
            </div>
        );
    };

};

export default SlideBar;
